description:
Free the world of fairies from the grip of a dark magic in Alice and the Magic Gardens, a fun Match 3 game! Slide colored lockers into place to reveal the delicious fruits inside and then match identical fruits to earn points toward the completion of the level. Powerful bonus items like the Hammer and the Fruit Blaster add an extra element of fun to the already thrilling gameplay! Stop the evildoers and save the day in Alice and the Magic Gardens!
